"    Among 40,848 patients with an acute myocardial infarction entered into GUSTO-I, 20 percent had recurrent ischemia after thrombolytic therapy. The 30-day and&nbsp;one year survivals were significantly lower among patients with recurrent ischemia associated with hemodynamic abnormalities (eg, hypotension) compared to patients without recurrent ischemia or those with recurrent ischemia without hemodynamic abnormalities (p &lt;0.0001).",
